function render_cart(){post($("[data-cart]").data("cart"),[],"","","","","render_cart_items")}function render_cart_items(a){let mini_cart_item=$("[data-mini-cart-item-template]").html();let cart_item=$("[data-cart-item-template]").html();let total=0;let quantity=0;if(a.length>0){$("[data-cart-items]").removeClass("dn").html("");$("[data-empty-cart]").addClass("dn");$(a).each(function(b,c){console.log(c);if(mini_cart_item!==undefined){let mini_item=mini_cart_item.replaceAll("{{title}}",c.prod_title).replaceAll("{{params}}",c.prod_params!==undefined?c.prod_params:"").replaceAll("{{quantity}}",c.cart_quantity).replaceAll("{{price}}",c.prod_price_view).replaceAll("{{url}}",c.prod_url).replaceAll("{{id}}",c.prod_id).replaceAll("{{image}}",c.prod_image);$("[data-mini-cart-items]").append(mini_item)}if(cart_item!==undefined){let item=cart_item.replaceAll("{{title}}",c.prod_title).replaceAll("{{params}}",c.prod_params!==undefined?c.prod_params:"").replaceAll("{{quantity}}",c.cart_quantity).replaceAll("{{price}}",c.prod_price).replaceAll("{{price_view}}",c.prod_price_view).replaceAll("{{url}}",c.prod_url).replaceAll("{{total}}",c.prod_total).replaceAll("{{total_view}}",c.prod_total_view).replaceAll("{{id}}",c.prod_id).replaceAll("{{image}}",c.prod_image);$("[data-cart-items]").append(item)}$("[data-cart-item-id]").val();quantity++;total+=parseFloat(c.prod_total)})}else{$("[data-cart-items]").addClass("dn");$("[data-empty-cart]").removeClass("dn")}$("[data-cart-total]").html(total);$("[data-cart-quantity],[data-cart-count]").html(quantity)};